		public static Dictionary<string, string> Prs(string qst)
		{
			string[] pts = qst.Split('&');
			var qry = new Dictionary<string, string>();

			foreach (string prt in pts)
			{
				string[] stt = prt.Split('=');
				string prm = stt[0];
				string pmt = stt[1];

				qry.Add(prm, pmt);
			}

			return qry;
		}
